import React from "react";
import moment from 'moment'
import styled, { ThemeProvider } from 'styled-components';
import NoSsr from '@material-ui/core/NoSsr';
import { createMuiTheme } from '@material-ui/core/styles';
import { palette, spacing, typography } from '@material-ui/system';

const Box = styled.div`${palette}${spacing}${typography}`;

//const theme = createMuiTheme();

class Weathercomp extends React.Component {
	render(){
return(
	<NoSsr>

        <Box
          color="primary.main"
          bgcolor="background.paper"
          fontFamily="h6.fontFamily"
          //fontSize={{ xs: 'h6.fontSize', sm: 'h4.fontSize', md: 'h3.fontSize' }}
          p={{ xs: 2, sm: 3, md: 4 }}
        >
          <span style={{fontSize:32 }}>{this.props.Temperature && this.props.Temperature} </span>

          {this.props.city && this.props.country && <span> {this.props.city},{this.props.country} </span>}

          {this.props.description && 
					<div>{moment(this.props.Datecity).format('llll')}</div> 
				}
        </Box>

    </NoSsr>





	 	);}


}


export default Weathercomp;
